insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (45,24,'Elvet Studios','Green Lane','DH1 3UA',54.7738802,-1.5647951,'Elvet Studios, 是位于杜伦2013年9月投入使用的崭新豪华宿舍。 离杜伦大学，Ustinov 学院以及市中心均需要步行几分钟，视野较好，能看到大学，河岸，跑马场等。 通过一条石头路便是杜伦大学的经济，金融和商务，社会学，运动和哲学系，以及大学的划船俱乐部和板球场。 距Bill Bryson 图书馆和新Palatine 中心大约步行10分钟。  该宿舍由112个不同种类自带卫浴和个人厨房的豪华套间（studios）构成，给您提供独立的生活环境。在其公共活动区，您可以可以和朋友共享还可以认识来自世界各地的舍友。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (46,24,'St Margaret’s Flats','St Margarets Garth','DH1 4DS',54.7758653,-1.5841512,'St Margaret’s Flat 是位于杜伦新近装修的高规格的学生宿舍，离市中心大约一公里。该宿舍由22个带独立卫浴共用和厨房的5人套间（En Suite）构成。可以和朋友共享还可以认识来自世界各地的舍友。 每个房间提供小双人（3/4  120x190cm）, 大学习桌，台灯， 衣橱，等。 最多5共用一个厨房， 提供自行车库等设施。1镑预定订，剩余99镑在2014年4月之前支付。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (47,29,'Gallery Apartments','2 Port Dundas Place','G2 3LD',55.8652908,-4.2532336,'Gallery Apartment 是位于格拉斯哥中心的豪华，高标准现代化学生宿舍。地理位置优越，距格拉斯哥Caledonian 大学大约步行3分钟，格拉斯哥艺术学院大约10分钟。步行或者地铁也可方便到达其他大学。该宿舍由126个不同类型的带独立卫浴和厨房的套间（studio）和7个2两室公寓（two bed Apartment）构成。专属的个人空间让您充分享受独立自由的生活。 不同类型的房间，可以满足一个独住或者两人居住的要求， 不管您是本科生，还是研究生海外学生这里都是您理想的选择。','HAS_VACANCY', now(), now());
