insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (49,25,'Sugarhouse Close','Sugarhouse Close','EH8 8JR',55.950044,-3.1809814,'Sugarhouse Close 位于是一所位于爱丁堡中心的全新豪华学生宿舍。附近有酒吧，餐馆，商店等场所。该宿舍提供带有独立卫浴的套间（En-Suite），共用厨房，可以和朋友共享还可以认识来自世界各地的舍友。如果你喜欢独立生活，同时提供带有独立厨房和卫浴的套间（Studio）。 在其公共活区域您还可以和朋友一起放松，分享学习生活经验等。预订需要支付1镑预订费，剩余的249镑在2014年4月之前支付。','HAS_VACANCY', now(), now());
