insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (53,29,'Clearmont House','20 N Claremont Street','G3 7LE',55.8664925,-4.2802027,'Clearmont House格拉斯哥2014投入使用的全新学生宿舍。位于Kelvingrove Park 地区，距格拉斯哥大学，Sport Club，学生会，以及格拉斯哥艺术学院只需要步行大约12分钟。同时靠近格拉斯西，附近有各种商店，餐馆，小吃店，酒吧等离市中心只有几分钟的距离。天晴晴朗的时候您还可以附近的Kelvingrove 公园，学习和享受这里的新鲜空气。该宿舍由不同类型带独立卫浴和厨房的套间（studio）构成。专属的个人空间让您充分享受独立自由的生活。 在其公共活动室还有安静学习间，在这里您可以和朋友一起学习。无处不在的wifi您可以使用笔记本，ipad等。 ','HAS_VACANCY', now(), now());
