insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (55,44,'Hatbox','Castle Street','LU1 3AG',51.8754271,-0.4155605,'我们非常荣幸向您介绍在Luton最新的宿舍指之一Hatbox,地理位置优越，靠近Bedfordshire大学，附近有给类商店，酒吧等该宿舍至提供最好标准的房间，基于对学习压力的理解，我们提供全职宿舍管理团队。为您提供给随时服务。同时还提供给类公共区域设施，包含健身房，影院，学习区。 无线网贯穿整栋建筑，欢迎预约看房。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (56,44,'London Park House','Park Street','LU1 3EZ',51.8755091,-0.4089768,'London Park House 靠近Luton 中心，傍边便是Bedfordshire 大学。London Park House 是一所现代，特别为学生打造2014年9月份投入使用的全新宿舍。该宿舍提供高标准住宿。基于对您学习压力的理解，我们提供全职宿舍管理团队，为您提供给随时服务。能够在Luton中心提供这样一个社区，我们感觉非常荣幸。欢迎咨询并预约 看房。每一个Flat施舍齐全，提供设施齐全的厨房。另外还配有沙发，32寸带有Freeview和天空体育台的电视，都包含电视许可证。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (57,52,'Dorset House','London Road,  Headington','OX3 7FT',51.7721343,-1.2105434,'Dorset House 是牛津最新最新并位置俱佳的学生宿舍。该宿舍提供带独立卫浴的套间（ En suite）4,5或6人共用厨房和带d独立厨房和卫浴的套间（Studio）使其成为本科生，研究生以及海外学生的理想选择。该宿舍地理位置极佳，离牛津布鲁克斯主校区大约步行5分钟。请注意，牛津布鲁克斯的学生不需要提供担保人','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (58,102,'The Sidings','Station Road, Penryn','TR10 8HF',50.1711604,-5.1112863,'The Sidings 是Penryn的一所高质量的学生宿舍。提供独立风格的自带厨房和卫浴的套间（ Studio），和时尚带独立卫生间，共用厨房的套间( En Suite)。 大部分套间6或7个人共用一个厨房，在其公共区配有沙发，电视等设施，在您做饭的同时，还能充分放松和社交。Studio 的厨房以和卫生间设施齐全。物超所值的选择是本科生，研究生已经国际学生的理想选择。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (59,9,'Sunbridge Halls','178 Sunbridge Road','BD1 2HF',53.7974032,-1.7663433,'Sunbridge Halls是布拉德福德2014年最新开放的学生公寓，距离大学和市中心都很近。所有房间均为Studio式，含有独立卫浴和厨房。您可以在这里尽享私人空间。我们的每间Studio都经过了精心设计，拥有42寸平板电视（含TV Licence）、10Mbps宽带和Wifi、极致舒适的泰普尔床垫、运动感应灯光、完备的卫浴和厨房设施、沙发与书桌座椅、以及24小时安保和电子门禁系统。一切就绪，就等着您来入住了。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (60,48,'Portland Green','Stoddart Street, Shieldfield','NE2 1AW',54.9766494,-1.5983081,'Portland Green是Newcastle最新的学生公寓。所有房间都提供现代化家居，包括3/4床、独立卫浴、20Mb超高速宽带和Wifi。内部装潢很时尚。这里交通便利，距离Northumbria University城市校区仅仅几分钟的步行路程，也有便利的公交线路通往University of Newcastle。公寓提供的自行车存放处也提供了额外的选择。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (61,31,'Ashenhurst Houses','Athene Drive, Newsome','HD4 6QN',53.6341948,-1.7710504,'Ashenhurst Houses是哈德斯菲尔德大学官方认证并推荐的两个学生公寓之一（另一个是Storthes Hall Park）。它距离大学约1.2英里。我们可最多容纳280名学生居住，有两种房型供您选择。所有套间都配备了齐全的家居设施。每个套间包含六至八个单人卧室，大家共享卫浴设施和一个现代化厨房兼客厅。我们还有专门的洗衣房和露天野餐区域。我们还为您提供免费的物品保险。如果您想要寻找一处安静而舒适的宿舍居住的话，那么这里将会是很好的选择。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (62,31,'Storthes Hall Park Student Village','Storthes Hall Lane, Kirkburton','HD8 0WA',53.6167163,-1.7157474,'Storthes Hall Park可容纳大约一千三百名学生居住，是整个英国最大的学生村之一，也是哈德斯菲尔德大学官方认证并推荐的两个学生公寓之一（另一个是Ashenhurst Houses）。它距离大学约4.5英里，有免费班车连接公寓与学校和市中心。公寓本身就是一个大公园，环境优美而且十分安静，很适合想要拜托喧嚣的困扰而沉下心来努力读书的同学。我们提供多种房型。所有的房型都包括独立卫浴。我们还为您配备了现代化的厨房和会客厅，由每六至八人分享。此外，我们建设了健身房、娱乐中心和Mini超市等设施来方便您的生活。我们还提供免费的物品保险、24小时安保和CCTV监控系统，让您可以不必担心安全问题。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (63,45,'Weston Court','45-47 Cromwell Range, Fallowfield','M14 6HH',53.4479569,-2.217425,'Weston Court是曼彻斯特最舒适的学生公寓之一。租期分为48周和44周。这里位于曼城最受学生欢迎的地区之一，每个房间都提供了一张3/4大床，足够的储物空间。2-4人共享一体式的厨房和会客厅，包括电视和沙发供你使用。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (64,45,'Beechwood House & Gardens','9-11 Ladybarn Lane, Fallowfield','M14 6NQ',53.4408913,-2.2142501,'Beechwood位于安静的Fallowfield地区，特别适合研究生入住。这里提供了55个房间，有48周和44周两种租期。所有房间都提供了3/4大床等全套家具。每2-4人共享一体式的厨房和会客厅，包括我们提供的沙发和电视。我们还为特别您准备了洗衣机和干衣机。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (65,60,'The Pinnacles','83 Broad Street','S2 5TL',53.383614,-1.4574276,'The Pinnacles是谢菲尔德最好的学生公寓之一。这里地理位置优越，只需步行就可以走到谢菲尔德哈勒姆大学。而乘坐电车也只需10分钟即可到达谢菲尔德大学。我们为您提供二至五人套间和Studio。所有住户都可以享用独立卫浴。我们还为您准备了现代化的厨房设施、20Mb的超高速宽带和Wifi来满足您的需要。另外我们的公共休息室安装了投影设施，您不妨在课余之时同您的小伙伴一起来这里放松。我们甚至还有台球桌和乒乓球桌供您使用。此外我们还为您贴心安装了取款机，让您在需要的时候不用东奔西跑。24小时安保和CCTV监控系统让你不必为安全问题而担心。','HAS_VACANCY', now(), now());
