insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (67,7,'The Cube','87-93 Bradshawgate','BL1 1QD',53.5771988,-2.4255231,'The Cube是Bolton最新修建的学生公寓，附近有很多超市、商店和餐厅。这里距离Bolton大学只有10分钟的步行路程，将是学生居住的绝佳场所。我们拥有现代时尚的房间和齐全的附属设施。每一个studio大约18m2。我们努力为您的生活和学习创造良好的私人空间，精心准备了3/4大床、衣柜、储物柜、桌椅、独立卫浴和厨房等设施。我们也拥有很多公共区域，给您和您的小伙伴朋友之间的交流提供了便利。另外还有20Mb的高速宽带和WIFI将您同全世界联系在一起。','HAS_VACANCY', now(), now());
