insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (80,6,'Mansion Canalside','Lower Loveday Street','B19 3SJ',52.4879066,-1.8983694,'Mansion Canalside坐落于历史悠久的伯明翰中心地带，并且紧挨着美丽的河道。公寓的位置非常理想，无论您在该市的哪所大学就读，都可以很方便地到达。其中Aston大学步行短程即到，我们还提供免费的摆渡车前往那里。周边其他大学还包括有伯明翰大学、伯明翰城市大学、法学院等。伯明翰是英国第二大城市，也是著名的购物天堂，市中心商场林立。在公寓附近还有医院等公共设施，和无数的餐馆、咖啡馆、酒吧等娱乐场所。所以，居住在这里，您不仅可以安心学习，还能在课余尽享休闲娱乐生活。周边大学距离：Aston大学0.7英里， 步行7分钟或者乘坐免费摆渡车5分钟。Birmingham City大学2.4英里，乘坐935路汽车9分钟。Birmingham大学3.2英里，乘坐61路汽车22分钟。','HAS_VACANCY', now(), now());
