insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (87,42,'Mansion Hive','65 Three Colts Lane, Bethnal Green','E2 6BF ',51.5246181,-0.0559487,'如果您是一个渴求丰富的文化生活的时尚达人，那么您一定会喜欢Mansion Hive的居住环境。你到公寓周边看看就会欣喜的发现这里是一个多么炫酷的文化艺术区。最棒的商店、受人追捧的艺术文化音乐场所，时尚的餐厅和酒吧、公园、绿地等等都在你的家门口。另外，从这里乘坐地铁可以方便地的到达伦敦主要大学。如果你想骑车探索伦敦，我们也提供自行车存放处，当然要先到先得哦！公寓提供多种Studio房型。所有房型都按最高标准进行设计和装修。我们为您提供完备的现代化时尚家居设施。此外，公寓的公共休息室还提供Sky TV和台球桌，您不妨同朋友来这里放松。特别值得一提的是，您还可以在公寓的屋顶花园欣赏伦敦的夜景。附近地铁站: Bethnal Green','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (88,42,'Mansion Bloomsbury','101-105 Gower Street','WC1E 6AA',51.5230275,-0.1332424,'如果你的愿望是生活在伦敦的绝对心脏地带，全英的目光焦点中心。那就来Mansion Bloomsbury吧！它的位置无可比拟，紧邻伦敦众多大学，周边还有星罗密布的剧院、音乐中心、餐馆、酒吧、商店等等，这就意味着在您的学习之余，您可以尽情体验伦敦最精彩的生活。这座由列入国家保护建筑名单的建筑改造而成的学生公寓完美地融合了古典和现代元素。我们为您提供多种房型选择。所有住户都可享用现代化的生活设施，包括高标准配置的厨房、卫浴和卧室。我们还提供配备PS3和豆袋的公共休息室和带有BBQ区域的庭院。而24小时安保更让您可以不必为安全问题而担心。附近地铁站: Goodge Street附近大学：CSMCityKing’s CollegeLSEUCL SOASShool of LawRCAWestminster大学','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (89,42,'Mansion Wharf','101 Lower Road','SE16 2XG',51.4959362,-0.0518957,'Mansion Wharf是一个刚刚重新装修过的现代化时尚学生公寓。伦敦金融城、Tower Bridge、The Tower of London 近在咫尺。周围有很多便利店、餐馆和酒吧。它位于Zone 2之内，距离地铁站仅有几分钟步行距离。通过伦敦发达的交通网络，您可以轻松去往市内各处院校和景点。我们致力于为住户创造安全、友好、舒适的生活环境，让您产生浓厚的归属感。无论您选择什么房型，我们都会为您提供最棒的服务。附近地铁站: Canada Water','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (90,42,'Mansion SW3','Manresa Road','SW3 6NA ',51.487451,-0.1714342,'伦敦的皇家切尔西和肯辛顿区是每个人谈到都充满向往的上流阶层居住区。这里毗邻大学区，周围是富人的天堂，著名的皇家行政区亦坐落于此。而我们的Mansion SW3就地处这个贵族地段的核心。紧邻闻名于世的King’s Road，不管您如何出行，著名的景点总是近在咫尺。西敏寺教堂就在眼前，步行六分钟便可到达议会大厦，乘坐10分钟地铁便可去往诺丁山。帝国理工、Westminster大学等诸多院校都在步行范围内，而其它学校也可通过地铁很快到达。我们的所有住户都可享用独立卫浴和现代化的厨房设施。房间雅致清新，内饰时尚一流。无论您选择同他人共享两人套间还是单独入住Studio，我们都能满足您生活和学习方面的需要。附近地铁站: Sloane Square和South Kensington','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (91,42,'Mansion Hub','21-25 South Lambeth Road, Vauxhall','SW8 1SU ',51.4845478,-0.1226544,'2013年初全新开业的Mansion Hub提供了伦敦顶级的专业学生住宿环境。公寓位于伦敦富人区，位置极佳，坐拥伦敦繁华的酒吧、餐厅和外卖店。沿着泰晤士河畔散步，十五分钟可以到达伦敦著名的大本钟和伦敦眼。而附近便利的交通可以让你轻松到达伦敦的所有景点和大学。公寓提供多种Studio房型。所有房型都经过精心装修。房间里宽敞明亮而且设施齐全。我们给每间Studio都提供了平板电视。更有配备大尺寸电视的公共休息室供您和您的朋友联络感情之用。我们还安装了门禁系统和CCTV监控系统，随时保障您的安全。附近地铁站: Vauxhall','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (92,42,'Mansion Tower','60 Courland Grove','SW8 2PX ',51.471842,-0.1310011,'如果您希望能居住在附带健身房的现代化高标准学生公寓里，那么Mansion Tower是一个不错的选择。公寓附近有很多餐馆、酒吧和Club等着您去探索。便利的交通网络也让您可以轻松去往伦敦的各大院校和景点。我们特别提供免费摆渡车连接公寓和临近的Stockwell地铁站。如果您选择骑车或者驾车出行，我们还提供免费的自行车存放处和停车场。我们为您提供多种Studio房型。所有房型都专为年轻人量身定做。学习之余，您可以在我们全套配备的健身房里做做运动，或者选择在高清纯平电视机前放松，之后在自己独立的浴室里冲一个热水澡，然后在花岗岩餐桌上享受一份美味晚餐，最后躺在舒适的双人床上缓缓进入睡眠。如果您想与小伙伴联络感情，您也不妨到我们设置的公共休息室里来。居住在这里，您可以尽情享受美好的学生生活。附近地铁站: Stockwell','HAS_VACANCY', now(), now());
