insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (113,51,'Mansion Square','Russell Street','NG7 4FL',52.9593293,-1.164476,'虽然诺丁汉城市新建的学生公寓不少，但是像Mansion Square这样如此有风格的建筑实在稀少。这座由国家保护建筑改建而成的现代化学生公寓将为你带来不一样的学生生活体验！我们最新的改建让其保留了原有的古典风格同时也增加了我们自己的特色，查看图片就知道了，干净、新鲜、高雅、别致是它的代名词。公寓坐落在在诺丁汉市中心，只需步行即可到达诺丁汉特伦特大学。公寓旁边还有便捷的公交车和有轨电车(tram)连接其它大学。另外对于喜欢骑行的同学，我们也提供了自行车存放处。这里的国际大家庭氛围很浓厚，你可以想象一下和来自各国的室友们在设计时尚的厨房和休息室内闲聊交友。您也可以选择单独入住我们的Studio。周边大学距离：诺丁汉大学 2.0英里 乘坐34路公汽20分钟诺丁汉特伦大学 0.8英里 步行15分钟诺丁汉语言学院 步行7分钟诺丁汉新学院 1.3英里步行25分钟或者乘坐41路公汽6分钟','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (114,51,'The Glasshouse','Union Road','NG3 1FG',52.9582596,-1.1450345,'The Glasshouse在诺丁汉学生群体中远近闻名。它位于诺丁汉的市中心，周围围绕着各式的商店、超市、餐馆和酒吧。从这里到诺丁汉特伦特大学走路只需要10分钟，而其它大学也与这里通过便利的交通连接。值得一提的是，我们还准备了一些免费公交卡（数量有限呦！）来方便就读于诺丁汉大学的住户。公寓于2012年暑期重新装修，所以你看到的是一座崭新房子，看看图片你就能知道它的面貌。我们为您提供很多房型，请别挑花了眼。无论是您选择同他人共享厨房等空间还是单独入住Studio，我们都能够满足您的需求。我们还设置了专门的公共休息室，那里有Sky TV。我们尽力为学生营造一个轻松和谐的居住环境。为了您的安全，我们提供门禁系统和CCTV监控系统。所有住户都可以享受安全和安静的生活。我们的管理人员认真负责而且专业，他们会帮您解决您遇到的任何问题。周边大学距离:诺丁汉大学 2.5英里 乘坐18路公汽20分钟诺丁汉特伦大学 0.6英里 步行8分钟诺丁汉新学院 步行11分钟','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (115,51,'Mansion Studios','100-102 Talbot Street','NG1 5NF',52.9562032,-1.1582333,'Mansion Studio 是诺丁汉市中心全新落成的学生公寓。这个焕然一新的公寓距离酒吧、餐厅、外卖店、商店、超市和运动场都近在咫尺。诺丁汉特伦特大学只需几分钟步行就可以到达。而其它大学也与这里通过便利的交通连接。值得一提的是，我们还准备了一些免费公交卡（数量有限呦！）来方便就读于诺丁汉大学的住户。这里提供多种Studio房型。所有的 Studio 都按照诺丁汉的最高标准建造，内含独立卫浴、独立的现代化厨房设施、宽带与Wifi、平板电视以及常用家具。当然，居住在独立空间并不意味着您将与他人隔绝。我们提供的公共休息室将会是您与朋友联络感情的好去处。那里有Sky TV和台球桌供您和您的朋友一起享用。为了保证您的安全，我们还提供门禁系统和CCTV监控系统。我们的管理团队也随时为您提供帮助。周边大学距离:诺丁汉特伦大学 0.3英里 步行8分钟诺丁汉大学 1.9英里 乘坐18路公汽17分钟诺丁汉语言学院 步行5分钟','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (116,52,'Cambridge Terrace','4-6 Cambridge Terrace','OX1 1RN',51.7490873,-1.2586671,'Cambridge Terrace坐落于独特而且历史悠久的牛津市中心。绝佳的地理位置为学生提供无可比拟的便利。公寓旁边就有很多商店、餐馆和酒吧等生活设施， 而牛津大学也在步行范围之内。您也可以通过便利的交通轻松到达牛津布鲁克斯大学。这里是符合牛津最高标准的学生公寓。我们的豪华公寓为您提供了舒适的大床、现代化的厨房设施、壁挂式平板电视、Wifi以及独立卫浴。我们还为您创造了浓厚的社交氛围。您可以在我们提供的宽敞的公共休息室里与朋友和邻居一起消磨课余时光。我们安装了门禁系统和CCTV监控系统来保证您的安全。我们还有一支认真负责的专业管理团队随时帮你解决您的各种需求。','HAS_VACANCY', now(), now());
insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (117,52,'Mansion Mews','Glanville Road','OX4 2FG',51.7417293,-1.2234585,'我们将现代建筑和当代生活结合在一起打造了这幢三层楼高的学生公寓。它坐落于富有历史气息的牛津的中心，周边是很受欢迎的学生聚集区。附近有一系列的便民设施，包括商店、餐馆和酒吧等。牛津大学和牛津布鲁克斯大学的主校区也不是太远。这片区域也受益于附近完善的交通线路，包括来往于牛津市中心的固定班车，让您能够很方便地领略这座城市的魅力。在这里，您可以选择与他人共享空间，或者单独入住Studio。我们所有房型都经过了精心设计和布置，设施齐全。所有房间都有独立卫浴。我们还提供宽敞的公共休息室让您享受社交的快乐。我们经验丰富而且认真负责的管理人员也会帮您解决您遇到的一切问题。公寓安有门禁系统和CCTV监控系统。所以您尽可放心您的安全。周边大学距离：牛津大学 2.1英里 乘坐1路/5路/10路公汽30分钟牛津布鲁克斯大学1.2-2.0英里 乘坐U1/U5/8路公汽30 分钟','HAS_VACANCY', now(), now());
