insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (119,42,'Pure Highbury','201 Isledon Road','N7 7JR',51.5609596,-0.1090945,'这个高质量，低价格学生公寓向学生提供不同的房间类型选择，我们的设施包括一个户外公共花园，公共休息区，以及自带的健身房。所有这些设施都集中在Pure Highbury大楼的中心位置: Mezzanine floor。所有房间都配有4英尺的双人床，大衣柜，书桌，储物柜，以及足够的床下储物空间！这里距离Finsbury Park地铁站只有2分钟的步行距离；乘坐地铁20分钟之内可以到达18所伦敦市中心主要的大学，到King’s Cross & St. Pancras 国际车站也只有仅仅6分钟的地铁车程。特别服务：我们为您免费提供一套床上用品（床单、枕头、被子）和免费物品保险。','HAS_VACANCY', now(), now());
