insert into dormitory (id, city_id, name, address, postcode, latitude, longitude, description, status, create_time, update_time) values (122,42,'The Stay Club @ Camden','34 Chalk Farm Road, Camden','NW1 8AJ',51.542726,-0.1477186,'TSC Camden坐落于繁华的商业街中心，离世界著名的Camden集市和Camden船闸很近，周围有很多商店、餐馆和酒吧。离TSC Camden最近的地铁站是只有三分钟步行距离的Camden Town站和Chalk Farm站。从这里，很快就能到达遍布伦敦的各大学校园。从2013年开张以来，TSC Camden已经拥有250个最高标准的Studio式寝室，很大的公共休息区以及七间学习室，适合所有在伦敦就读的学生入住。我们独具风格的装潢和酒吧式的公共休息室受到了住户的一致好评。跟其他学生公寓不同，我们不要求租金一次付清，而是采取月付方式。我们独有的特色服务还包括：每周免费更换床单和毛巾，免费房间清洁，提供免费厨房用具和餐具。而且，我们还采用了最先进的地暖系统和雨滴式淋浴系统。这一切都让我们成为伦敦最棒最独特的学生公寓。','HAS_VACANCY', now(), now());
